// Dans api.js
const LOCAL_AGENT_URL = 'http://localhost:8000';
const RUNPOD_URL = 'https://0nf9jzlfas5xdv-8001.proxy.runpod.net';

export const getOpenWorkbooks = async () => {
  try {
    const response = await axios.get(`${LOCAL_AGENT_URL}/get_open_workbooks`);
    return response.data;
  } catch (error) {
    console.error('Error fetching workbooks:', error);
    throw error;
  }
};

export const analyzeSheet = async (workbook, sheet, query) => {
  try {
    const response = await axios.post(`${LOCAL_AGENT_URL}/analyze_sheet`, {
      workbook,
      sheet,
      query
    });
    return response.data;
  } catch (error) {
    console.error('Error analyzing sheet:', error);
    throw error;
  }
};
